import React, { useState } from 'react';
import { Button, Container, TextField,  } from '@mui/material';
import { isEditable } from '@testing-library/user-event/dist/utils';
import axios from 'axios';

interface SubmitProps {
    ingredients: Array<string>,
    setWrittenRecipe: Function
};


export async function requestGeneratedRecipe(ingredientsList: Array<string>){

    var URL = "http://172.31.81.52:8000/getRecipe?"

    ingredientsList.forEach(element => {
        URL += `&i=${element}`
    });
    
    console.log(URL)

    axios.get(URL)
    .then(res => {
        return res
    })
}



function SubmitForm(props: SubmitProps){
    return (
        <Button variant="outlined" onClick={() => {
            requestGeneratedRecipe(props.ingredients).then(res => (print(res), props.setWrittenRecipe(res)));
        }}>SUBMIT</Button>
    )
}   

export default SubmitForm;
